Ext.data.JsonP['Appcelerator_CLI_5.0.3_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Appcelerator CLI 5.0.3 - 12 October 2015</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46239629\" class=\"content\">\n                        <h1>Appcelerator CLI 5.0.3 - 12 October 2015</h1>\n    <p>Appcelerator CLI 5.0.3 is a patch release, addressing high-priority issues from previous release.    </p>\n    <div class=\"section section-2 \" id=\"src-46239629_AppceleratorCLI5.0.3ReleaseNote-ComponentVersions\">\n        <h2 class=\"heading \"><span>Component Versions</span></h2>\n    <p>The following components are shipped with CLI 5.0.3:    </p>\n    <div class=\"tablewrap\">\n        <table class=\"confluenceTable\">\n        <thead class=\" \">    <tr>\n            <td class=\"confluenceTh\" rowspan=\"1\" colspan=\"1\">\n        <p>Name    </p>\n            </td>\n                <td class=\"confluenceTh\" rowspan=\"1\" colspan=\"1\">\n        <p>Version    </p>\n            </td>\n        </tr>\n</thead><tfoot class=\" \"/><tbody class=\" \">    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p><strong class=\" \"><a class=\"external-link external-link\" href=\"https://github.com/appcelerator/alloy/releases\" target=\"_blank\">Alloy</a></strong>    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p><strong class=\" \">1.7.16 (update)</strong>    </p>\n            </td>\n        </tr>\n    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>Arrow Builder    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>1.2.62    </p>\n            </td>\n        </tr>\n    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>Arrow Cloud CL<strong class=\" \"><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Release_Notes\">I</a></strong>    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>1.0.27    </p>\n            </td>\n        </tr>\n    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p><strong class=\" \"><a class=\"external-link external-link\" href=\"https://github.com/appcelerator/titanium/releases\" target=\"_blank\">Titanium CLI</a></strong>    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p><strong class=\" \">5.0.5 (update)</strong>    </p>\n            </td>\n        </tr>\n</tbody>        </table>\n            </div>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46239629_AppceleratorCLI5.0.3ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/CLI-823\" target=\"_blank\">CLI-823</a>: libtiverify.a in Ti SDK is replaced by libappcverify.a    </p>\n</li><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/CLI-834\" target=\"_blank\">CLI-834</a>: Serious problem of consumption of RAM when using Genymotion emulator or iOS simulator    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46239629\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Appcelerator CLI 5.0.3 Release Note"});